import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return (
      <div>

        <div class="navbar">
          <a class="navbar-brand" href="#">Title</a>
          <ul class="nav navbar-nav">
            <li class="active">
              <a href="#">Home</a>
            </li>
            <li>
              <a href="#">Link</a>
            </li>
          </ul>
        </div>

      </div>
    )
  }
}
